/* Generated File Run.js in Project system_settings */	function close_system_settings(){	Minimizer.close("system_settings");}	function minimize_system_settings(){	Minimizer.minimize("system_settings");}	function maximize_system_settings(){	Minimizer.maximize("system_settings");}function open_system_settings(){}/* Initialize application */			function init_system_settings(){	$("#body-system_settings").keypress(function(event) {	}).mouseover(function(){	    $("#system_settings-container").draggable({disabled:true});    }).mouseout(function(){        $("#system_settings-container").draggable({disabled:false});    });		$("#system_settings-container").mousedown(function(){		Focus.set("system_settings");		setMenu_system_settings();			fixSizesystem_settingsSpeed = 0;	})	.mouseup(function(){		fixSizesystem_settingsSpeed = 300;	});		/* Make application resizable */	Resizable.set("system_settings");		$("#exit-system_settings").mousedown(function(){		close_system_settings();		$("#body-system_settings").val("");	});	$("#maximize-system_settings").mousedown(function(){		maximize_system_settings()	});		$("#minimize-system_settings").mousedown(function(){		minimize_system_settings()	});			fixSize_system_settings();}/* Fix size application */var fixSizesystem_settingsSpeed = 300;function fixSize_system_settings(){	setTimeout(function(){		if(LoadAppsID["system_settings"].onFocus){			height = $("#system_settings-container").height();			width = $("#system_settings-container").width();			$("#body-system_settings").css({"height" : height-45, "width" : width-5});		}		fixSize_system_settings();	},fixSizesystem_settingsSpeed);}/* Set application menu */function setMenu_system_settings(){	proIdApps = "system_settings";	var valMenu = "<span id=top-menu-item0 class=top-menu-item>System Settings</span>"+        "<ul id=top-menu-item0-down class=top-menu-item-down>"+            "<li onclick=minimize_system_settings(proIdApps)>Minimize</li>"+			"<li onclick=maximize_system_settings(proIdApps)>Maximize</li>"+			"<li onclick=close_system_settings(proIdApps)>Quit System Settings</li>"+        "</ul>";		$("#top-menu").html(valMenu);		Menu.fixedTopMenu();}/* Register application */function register_system_settings(){	$.post("system/applications/system_settings/layout/system_settings.html", function(data){		ApplicationRun[applicationOpened] = data;		ApplicationRun[applicationOpened] = ApplicationRun[applicationOpened];		$(".program").html(($(".program").html())+ApplicationRun[applicationOpened]);		setTimeout(init_system_settings,100);		fixSize_system_settings();		applicationOpened++;	});	}/* Running application */function run_system_settings(dir, fileName){}